  imprimir_pdf(datos) {
    
    
  var columns = [
      {title: "Folio", dataKey: "id"},
      {title: "Triage", dataKey: "triage_color"},
      {title: "Turno", dataKey: "turno"},
      {title: "Estado", dataKey: "estado_paciente"},
      {title: "CIE-10", dataKey: "cie10"},
      
  ];

  var rows = [];

  datos.forEach(element => {

    //console.log(element.id,element.movimientos_incidencias[element.movimientos_incidencias.length -1].subcategorias_cie10);

    //console.log(element.movimientos_incidencias[element.movimientos_incidencias.length -1].triage_colores.nombre);
  
      rows.push({"id": element.id,
      "triage_color": element.movimientos_incidencias[element.movimientos_incidencias.length -1].triage_colores.nombre,
      "turno": element.movimientos_incidencias[element.movimientos_incidencias.length -1].turnos.nombre,
      "estado_paciente": element.movimientos_incidencias[element.movimientos_incidencias.length -1].estados_pacientes.nombre,
      "cie10": element.movimientos_incidencias[element.movimientos_incidencias.length -1].subcategorias_cie10.nombre,
     });
  

  });



    let jsPDF = require('jspdf');
    require('jspdf-autotable');

    var doc = new jsPDF('l');

    var totalPagesExp = "{total_pages_count_string}";

    var base64Img1 = 'data:image/jpeg;base64,';

    var base64Img2 = 'data:image/png;base64,';
    var base64Img3 = 'data:image/png;base64,';

    var pageContent = function (data) {
      // HEADER
      doc.setFontSize(20);
      doc.setTextColor(40);
      doc.setFontStyle('normal');
      if (base64Img1 && base64Img2 && base64Img3) {
          doc.addImage(base64Img1, 'JPEG', 240, 9, 50, 20);
          doc.addImage(base64Img2, 'JPEG', 10, 10, 60, 20);
          doc.addImage(base64Img3, 'JPEG', 97, 3, 15, 15);
          doc.addImage(base64Img3, 'JPEG', 194, 3, 15, 15);
          
      }
      doc.text("Reporte de Incidencias", data.settings.margin.left + 110, 11);
      doc.setFontSize(8)
      doc.setFont('helvetica')
      doc.text("Sistema para la Gestin de Incidencias en Salud (SGiS)", data.settings.margin.left + 111, 15);

      // FOOTER
      var str = "Pagina " + data.pageCount;
      // Total page number plugin only available in jspdf v1.0+
      if (typeof doc.putTotalPages === 'function') {
          str = str + " de " + totalPagesExp;
      }
      doc.setFontSize(10);
      doc.setFontType("italic");
      doc.text(str, data.settings.margin.left, doc.internal.pageSize.height - 10);
  };

    doc.autoTable(columns, rows, {

          startY: 30,
          margin: {top: 30, horizontal: 7},
          styles: {columnWidth: 'wrap', fontSize: 8},
          columnStyles: {text: {columnWidth: 'auto'}},
          addPageContent: pageContent
    });

    if (typeof doc.putTotalPages === 'function') {
      doc.putTotalPages(totalPagesExp);
    }



    doc.save('Reporte de Incidencias.pdf');
    

  }

